// Categories.js
import React from 'react';
import './Categories.css'; // Make sure to create a Categories.css file for styling

const Categories = () => {
  return (
    <div className="categories-container">
      <div className="category">General PLC Information</div>
      <div className="category">Academic Materials Content</div>
      <div className="category">Strategy & Operations</div> {/* start of per-divison headers */}
      <div className="category">Program Coordinators</div>
      <div className="category">Engineering Learning Consultant Program</div>
      <div className="category">Peer Academic Coaching</div>
      <div className="category">Communications</div>
      <div className="category">Curriculum Design</div>
      <div className="category">Academic Skills Education</div>
    </div>
  );
}

export default Categories;
